custom_css:
// Testimonial Style 1
.testimonial_component1{
    .testimonial_card{
        box-shadow: rgb(0 0 0 / 8%) 0px 4px 12px;
        margin: 0px auto;
        padding: 5%;
        border-radius: 10px;
        max-width: 800px;
        .testimonial_card_image{
            img{
                height: 80px;
                width: 80px;
                border-radius: 50% !important;
            }
        }
        .testimonial_details{
            text-align: left;
            margin-top: 5%;
        }
        .testimonial_name{
            font-size: 20px;
            margin-bottom: 3px;
        }
        .ourteam_three_role{
            font-size: 16px;
            opacity: 0.5;
        }
        .testimonial_content{
            margin: 10px auto;
            line-height: 25px;
            font-size: 15px;
        }
    }

}
